import { Table, Row, Col, Container, Button } from "react-bootstrap";
import Clinic from "./Clinic";
import "./Clinic.css";
import { useContext } from "react";
import { DataContext } from "../../Data/DataContext";
function Tr(props) {
  const [userModal, setUserModal] = useContext(DataContext);
  return (
    <tr>
      <th>#</th>
      <th>{props.name}</th>
      <th>{props.phone}</th>
      <th>{props.email}</th>
      <th>{props.city}</th>
      <th>{props.account}</th>
      <th>{props.date}</th>
      <th>
        <Button
          variant="outline-primary"
          size="sm"
          onClick={() => setUserModal(true)}
        >
          Edit
        </Button>
      </th>
      <th>
        <Button variant="outline-primary" size="sm">
          Delete
        </Button>
      </th>
    </tr>
  );
}

export default Tr;
